import React from 'react';

const DescriptionSection: React.FC = () => {
  return (
    <div style={{ display: 'flex' }}>
      <img style={{ flex: '0 0 30%' }} src="path_to_your_image.jpg" alt="Descriptive alt text" />
      <div className="description-section" style={{ flex: '1' }}>
        <h2>Description Title</h2>
        <p>This is a description of the website. It can be as long or as short as you want it to be. You can also include any other elements you want in this section.</p>
      </div>
    </div>
  );
}

export default DescriptionSection;
